export function Mapping({
  provider,
  iconSize,
}: {
    provider: string,
    iconSize: number,
}) {
  switch (provider) {
    case "google": {
      return <Google iconSize={iconSize}/>;
    }
    case "github": {
      return <GitHub iconSize={iconSize}/>;
    }
    case "facebook": {
      return <Facebook iconSize={iconSize}/>;
    }
    case "microsoft": {
      return <Microsoft iconSize={iconSize}/>;
    }
    case "spotify": {
      return <Spotify iconSize={iconSize}/>;
    }
    case "discord": {
      return <Discord iconSize={iconSize}/>;
    }
    case "gitlab": {
      return <Gitlab iconSize={iconSize}/>;
    }
    case "bitbucket": {
      return <Bitbucket iconSize={iconSize}/>;
    }
    case "linkedin": {
      return <LinkedIn iconSize={iconSize}/>;
    }
    case "apple": {
      return <Apple iconSize={iconSize}/>;
    }
    case "x": {
      return <X iconSize={iconSize}/>;
    }
    case "twitch": {
      return <Twitch iconSize={iconSize}/>;
    }
    case "okta": {
      return <Okta iconSize={iconSize}/>;
    }
    case "catapa": {
      return <Catapa iconSize={iconSize}/>;
    }
    default: {
      throw new StackAssertionError(`Icon not found for provider: ${provider}`);
    }
  }
}

export function toTitle(id: string) {
  return {
    github: "GitHub",
    google: "Google",
    facebook: "Facebook",
    microsoft: "Microsoft",
    spotify: "Spotify",
    discord: "Discord",
    gitlab: "GitLab",
    apple: "Apple",
    bitbucket: "Bitbucket",
    linkedin: "LinkedIn",
    x: "X",
    twitch: "Twitch",
    okta: "Okta",
    catapa: "Catapa"
  }[id] || throwErr(`Unknown provider: ${id}`);
}

